export function Cart(prop) {
    return <div>
    <div className="col-md-6">
    <h3>Cart </h3>
    <table className="table table-dark table-bordered">
      <thead>
        <tr>
          <th>Title</th>
          <th>Category</th>
          <th>Price</th>
          <th>Count</th>
          <th>Subtotal</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
      {
                prop.data.map(elm => {
                    return <div className="col-md-3" key={elm.id} >
                        <p>{elm.title}</p>

                        <button onClick={() => props.onMove(elm.id)}>Dalete</button>


                    </div>
                })
            }
      </tbody>
    </table>
  </div>
</div>

}
